import React from 'react';
import './style.css';

import Search from './Search';
import AddStartUp from './AddStartUp';

class navbar extends React.Component {
  render() {
    return (
      <div className="navbar">
        <span className="name">{this.props.name}</span>     
        <Search/>
        <AddStartUp/>
      </div>
    );
  }
}

export default navbar;
